    false,nt"url": null,nt"notes": "nThirty-four drift tracks in the Arctic
    Ocean pack ice are collected in a unified tabular data format, one file per track.
    Data are from drifting ships, manned research stations on ice floes (ice islands)
    and data buoys. Track names are FRAM (ship, 1893 to 1896), NP-01 through NP-20 (Soviet
    North Pole stations on ice floes, 1937, 1950, 1954 to 1970), IGY-A and IGY-B (International
    Geophysical Year ice camps, 1957 to 59), T-3 (Fletcher's Ice Island, 1959 to 1970),
    ARLIS-II (Arctic Research Laboratory Ice Station II ice camp, 1961 to 1965), BTAE
    (British Transarctic Expedition, 1968 to 1969), seven buoys deployed during the
    AIDJEX (Arctic Ice Dynamics Joint Experiment) pilot study (1972), TEGG (Austrian
    ship Tegetthoff, 1872 to 1873) and St. Anna (Russian ship, 1912 to 1914).n",nt"license_title":
